import React from 'react';
import '../styles.css';

const History = () => {
  return (
    <div className="container">
      <section className="content-section">
        <h2>Historie Restaurace</h2>
        <p>
          Restaurace U Bernarda, která se nachází v historických prostorách bývalého pivovaru, nabízí skvělou atmosféru a širokou nabídku jídel. Každý den se zde mění polední menu, které zahrnuje tradiční česká jídla jako svíčkovou na smetaně, pečené vepřo s knedlíkem nebo hutné polévky.
        </p>
        <p>
          Jídelní lístek obsahuje rozmanité masové pokrmy, saláty, zeleninová jídla a těstoviny, včetně nabídky pro děti. V restauraci si můžete vychutnat pestrý nápojový lístek, který zahrnuje tradiční světlé a tmavé pivo, vína z českých a moravských vinic i koktejly.
        </p>
        <p>
          Je to ideální místo pro oběd s přáteli nebo oslavy důležitých okamžiků.
        </p>
      </section>
    </div>
  );
};

export default History;
